INSERT INTO `categories` (`id`, `name`, `description`, `thumb`, `banner`, `layout`, `created_at`, `updated_at`) VALUES
(6, 'Tableware', 'The chefs canvas for creative presentation, choose from a vast portfolio of high quality tableware from renowned brands designed to add a blend of performance and style to casual and fine dining menus.', '1515521654T.jpg', '1506020106B.jpg', 1, '2017-03-11 15:15:41', '2018-01-10 00:14:14'),
(7, 'Glassware', 'Leading glassware brands for modern drinks service featuring high quality and cost-effective stemware, tumblers and speciality glasses.', '1515521768T.jpg', '1506019577B.jpg', 1, '2017-03-11 15:17:55', '2018-01-12 03:05:06'),
(9, 'Presentation and Display', 'Add innovation and imagination to food presentation with our vast collection of presentation and display solutions.', '1515521474T.jpg', '1506019892B.png', 2, '2017-03-11 15:21:56', '2018-01-18 19:51:51'),
(10, 'Buffet and Deli Display', 'Add creativity and wow factor to buffet and counter displays with our innovative display solutions including Zhu Bamboo Fibre, Melamine & Ceramic.', '1506020182T.jpg', '1506020182B.jpg', 2, '2017-03-11 15:25:40', '2018-01-20 22:38:50'),
(11, 'Bakeware & Oven-to-Table', 'A wide range of Stoneware designed to perform in busy catering environments. This collection is oven, microwave, freezer and dishwasher safe and is ideal for food preparation or presentation.', '1506020223T.jpg', '1506020223B.jpg', 4, '2017-03-11 15:26:29', '2018-03-13 16:25:10'),
(12, 'New Products', 'New for 2017! Over 250 fantastic new products including additions to our highly acclaimed Seasons by Porcelite, Rustico Stoneware and Porland Academy Fine China collections.', '1506021096T.jpg', '1506021096B.jpg', 4, '2017-03-11 15:27:27', '2018-01-16 00:20:28'),
(13, 'Bespoke Tableware', 'We can offer a comprehensive, efficient and cost effective solution to all your personalised tableware needs.', '1506021137T.jpg', '1506021137B.jpg', 1, '2017-03-11 15:28:17', '2017-09-22 00:12:17'),
(15, 'Cutlery', 'Cutlery', '1515520944T.jpg', '1515520663B.jpg', 2, '2018-01-09 23:57:43', '2018-01-10 00:02:24'),
(16, 'Kitchenware', 'Kitchen ware', '1520743801T.jpg', '1520873588B.jpg', 4, '2018-02-28 03:41:56', '2018-03-12 21:53:08'),
(17, 'Miscellaneous', 'Miscell', '1520742886T.jpg', '1520742886B.jpg', 4, '2018-03-11 09:34:46', '2018-03-11 09:34:46');
