(3299, 'S237', 'Hygiplas Standard High Density Chopping Board Set ( 6 Board Set)', 1, '71.49', '71.49', 16, 0, 0, 0, 45, 8, 0, 0, 0, 0, '18x12x1/2 Thick, 18x12x1 Thick, 24x18x1/2 Thick, 24x18x1 Thick', 0, 1, '1519768830.jpg', '<p><b>HDPE. Six boards, wall chart and rack</b></p><div class=\"tabbody\" style=\"display: block;\">\r\n		<div class=\"tab-details\">\r\n	<p>Reduce the risk of food poisoning with the Hygiplas high density \r\nchopping board set. Colour coded to help staff identify the correct \r\nboard for each food type, the set helps you prevent cross contamination \r\nin your kitchen. Non-toxic, non-absorbent and easy-to-clean, the set \r\nmakes it easy for you to prepare food hygienically and safely. \r\nConstructed from high density polyethylene, the boards are incredibly \r\nrobust and durable, lasting you longer and saving you money on \r\nreplacements. This useful set includes six boards of different colours, a\r\n rack and chart for identifying them.</p>\r\n		<p class=\"product-features-heading\">\r\n	                <b>Product features</b></p>&nbsp; Material&nbsp;High Density Polyethylene\r\n            </div></div><p><b><br></b></p><p><b><br></b><br></p>', 1, 14537, '2018-02-28 04:00:30', '2018-03-24 23:42:08'),
