(3308, 'D610', 'Vogue 22 Piece Garnishing Set', 1, '32.99', '32.99', 16, 0, 0, 0, 46, 0, 0, 0, 0, 0, '', 0, 0, '1520713586.jpg', '<p><ol></ol>Ensure professional presentation at all times with the Vogue 22-piece\r\n garnishing tool set. Included in this high quality set are a wide \r\nvariety of carving tools, paring knives, a fruit and vegetable \r\ndecorator, double-sided fruit and vegetable scoop, birds beak knife, \r\npointer, stripper and a crinkle cutter. Designed with efficiency and \r\nfunctionality in mind, the utensils help you to effortlessly prepare all\r\n manner of ingredients, giving you excellent results while speeding up \r\nyour preparation times. The set is completed with an attractive and \r\nlightweight wooden case for easy and secure storage.</p><p>&nbsp;&nbsp;&nbsp; <b>Product features&nbsp; <br></b></p><p>&nbsp;&nbsp;&nbsp;&nbsp;Paring knives<br>&nbsp;&nbsp;&nbsp; Fruit and vegetable decorator and saw<br>&nbsp;&nbsp;&nbsp; Double sided fruit and vegetable scoop<br>&nbsp;&nbsp;&nbsp; Birds beak knife, pointer and flat stripper<br>&nbsp;&nbsp;&nbsp; Slanted knife and crinkle cutter</p><p style=\"display: block;\"><br></p><p style=\"display: block;\"><b>&nbsp;&nbsp;</b>&nbsp;&nbsp;&nbsp;&nbsp;</p>', 1, 15010, '2018-03-11 02:26:26', '2018-03-24 23:42:12'),
(3309, 'D614', 'Vogue 80 Piece Garnishing Set', 1, '49.99', '49.99', 16, 0, 0, 0, 46, 0, 0, 0, 0, 0, NULL, 0, 0, '1520715338.jpg', '<div class=\"tabbody\" style=\"display: block;\">\r\n<div class=\"tab-details\">\r\n<p>Ensure superb dish presentation with the Vogue high quality 80-piece \r\ngarnishing tool set. This set features a large selection of garnishing \r\ntools including cutting and sculpting knives, a variety of shaped \r\ncutters, peelers and melon ballers. Reliable, robust and constructed \r\nfrom premium materials, the utensils are designed for optimal efficiency\r\n and performance, giving you excellent results while reducing your \r\npreparation times. Presented in an attractive wooden case, the set is \r\nalso easy to organise and store in your kitchen. This garnishing set is \r\nthe perfect addition to any kind of kitchen where impeccable food and \r\nplate presentation is of the utmost importance.</p>\r\n<p class=\"product-features-heading\">\r\n<b>Product features</b></p>\r\n<ul><li>\r\nIncludes decorators, peelers, cutters, sculptors and more</li></ul>\r\n</div></div><p><br></p>', 1, 15011, '2018-03-11 02:55:38', '2018-03-24 23:42:12'),
