(3327, 'DM022', 'Vogue 6 Way Hand Grater', 1, '5.99', '5.99', 16, 0, 0, 0, 46, 0, 0, 0, 0, 0, NULL, 0, 0, '1520886168.jpg', '<div class=\"tabbody\" style=\"display: block;\">\r\n<div class=\"tab-details\">\r\n<p>Add more variety to your dishes with the Vogue six-way box grater. \r\nBoasting six different grating patterns, the grater gives you more \r\nchoice when preparing ingredients to help you create uniquely presented \r\nmeals. Made from incredibly robust stainless steel, the grater \r\neffortlessly shreds through all manner of ingredients to drastically \r\nreduce your preparation times. Featuring a strong ABS handle, the grater\r\n is also extremely versatile and durable, allowing it to cope with the \r\ndemands of any busy commercial kitchen.</p>\r\n<p class=\"product-features-heading\">\r\n<b>Product features</b></p>\r\n<ul><li>\r\nDimensions&nbsp;9(L)\"/ 230mm</li><li>\r\nMaterial&nbsp;Stainless Steel</li></ul>\r\n</div></div>', 1, 15045, '2018-03-13 01:22:48', '2018-03-24 23:42:12'),
(3328, 'DM020', '4 Way Box Grater', 1, '7.50', '7.50', 16, 0, 0, 0, 46, 0, 0, 0, 0, 0, NULL, 0, 0, '1520887480.jpg', '<p>Add an array of unique textures and flavours to your meals with the \r\nVogue four-way box grater. Boasting four different grating patterns, the\r\n heavy-duty grater helps you create a variety of different shreds to \r\ngive you more choice when preparing dishes. Made from premium stainless \r\nsteel, the grater shreds all manner of ingredients with ease to speed up\r\n your preparation times. Robust, reliable and affordable, the utensil is\r\n perfectly suited to any domestic or commercial kitchen.\r\n</p><div class=\"tabbody\" style=\"display: block;\"><div class=\"tab-details\"><p class=\"product-features-heading\">\r\n<b>Product features</b></p>\r\n<ul><li>\r\nDimensions&nbsp;254(L)mm</li><li>\r\nMaterial&nbsp;Stainless Steel</li><li>\r\nStainless steel with black handle and base</li><li>\r\n4 way grater allows for variety of shreds</li><li>\r\nLarge handle makes it comfortable to hold</li></ul>\r\n</div></div><p><br></p>', 1, 15035, '2018-03-13 01:44:40', '2018-03-24 23:42:12'),
(3329, 'CY024', 'Bonzer Classic R Bench Can Opener', 1, '80.29', '80.29', 16, 0, 0, 0, 51, 0, 0, 0, 0, 0, NULL, 0, 0, '1520887785.jpg', '<div class=\"tabbody\" style=\"display: block;\">\r\n<div class=\"tab-details\">\r\n<p>Open cans with ease with the Bonzer Classic R 16\" bench can opener. \r\nFeaturing a high quality, anti-bacterial steel blade, the opener \r\nguarantees sanitary and quick preparation to improve your serving times.\r\n Made with a dishwasher-safe, quick-release blade carrier and trigger \r\nmechanism, the opener is incredibly easy to clean, helping you keep it \r\nin fantastic condition. Able to open up to 10 cans a day, the opener is \r\nideal for use in pubs, guest houses and small restaurants. Suitable for \r\ncans up to 16\" high.</p>\r\n<p class=\"product-features-heading\">\r\n<b>Product features</b></p>\r\n<ul><li>\r\nDimensions&nbsp;16 1/5(L)\"/ 410mm</li><li>\r\nSupplier Model Number&nbsp;CRBZ0035</li><li>\r\nPatented quick-release blade carrier</li><li>\r\nDishwasher safe trigger mechanism</li><li>\r\nOpens up to 10 cans per day</li><li>\r\nIdeal for pubs, guest houses and small restaurants</li><li>\r\nAdvanced hygiene technology</li><li>\r\nAnti-bacterial blades</li><li>\r\nScrew down and clamp can opener base to flat surface</li></ul>\r\n</div></div>', 1, 15036, '2018-03-13 01:49:45', '2018-03-24 23:42:12'),
(3330, 'GD581', 'Bonzer Universal Can Opener Blades', 1, '17.59', '17.59', 16, 0, 0, 0, 51, 0, 0, 0, 0, 0, NULL, 0, 0, '1520888083.jpg', '<div class=\"tabbody\" style=\"display: block;\">\r\n<div class=\"tab-details\">\r\n<p>Guarantee a clean cut every time with these Bonzer universal can \r\nopener blades. Constructed from high grade carbon steel, the blades \r\npierce cans quickly and easily to ensure your service runs smoothly and \r\nefficiently. Made with an anti-bacterial coating, the blades last you \r\nlonger and give a safer cut to guarantee hygienic food preparation. \r\nIncredibly easy to install, the blades can be fitted immediately to get \r\nyour can opener back up and running. Can opener sold separately.</p>\r\n<p class=\"product-features-heading\">\r\n<b>Product features</b></p>\r\n<ul><li>\r\nSupplier Model Number&nbsp;CRBZ0049</li><li>\r\nAnti-bacterial coating</li><li>\r\nHigh grade carbon steel blades</li><li>\r\nEasy to fit</li></ul>\r\n</div></div>', 1, 15037, '2018-03-13 01:54:43', '2018-03-24 23:42:12'),
(3331, 'CF966', 'Kitchen Craft Potato Masher', 1, '5.49', '5.49', 16, 0, 0, 0, 48, 0, 0, 0, 0, 0, NULL, 0, 0, '1520888322.jpg', '<div class=\"tabbody\" style=\"display: block;\">\r\n<div class=\"tab-details\">\r\n<p>Mash potatoes with minimal effort, thanks to the Kitchen Craft \r\nprofessional masher. Made from high quality stainless steel, this masher\r\n is immensely strong and durable, helping you to effortlessly create \r\nsmooth mashed potatoes. The masher is also dishwasher safe to make \r\ncleaning quick and easy. Featuring a convenient hooked handle, the \r\nmasher can be stored on any racks or hooks to help you make the most of \r\nyour kitchen space.</p>\r\n<p class=\"product-features-heading\">\r\n<b>Product features</b></p>\r\n<ul><li>\r\nDimensions&nbsp;10 1/2(H)x 3(W)x 2 1/2(D)\"/ 265 x 75 x 65mm</li><li>\r\nMaterial&nbsp;Stainless Steel</li><li>\r\nWeight&nbsp;0.87kg</li><li>\r\nDurable and robust</li><li>\r\nHook for hanging</li></ul>\r\n</div></div>', 1, 15038, '2018-03-13 01:58:42', '2018-03-24 23:42:12'),
(3332, 'J740', 'Vogue Potato Masher', 1, '21.99', '21.99', 16, 0, 0, 0, 46, 0, 0, 0, 0, 0, NULL, 0, 0, '1520888615.jpg', '<div class=\"tabbody\" style=\"display: block;\">\r\n<div class=\"tab-details\">\r\n<p>Guarantee extra smooth mash with this high quality square potato \r\nmasher from Vogue. Constructed from stainless steel, the head is \r\nincredibly strong and robust, helping you mash large quantities of \r\npotatoes quickly and easily. Made with a polypropylene handle, the \r\nmasher is also ergonomic in the hand to help you comfortably work for \r\nlengthy periods of time. Dishwasher-safe, the masher can be cleaned with\r\n ease to help you keep it in great condition.</p>\r\n<p class=\"product-features-heading\">\r\nProduct features</p>\r\n<ul><li>\r\nDimensions&nbsp;Head size 150mm x 100mm/ 6\"x 4\"</li><li>\r\nMaterial&nbsp;Stainless Steel</li><li>\r\nStrong and durable</li><li>\r\nDishwasher safe</li><li>\r\nProduces extra smooth results</li></ul>\r\n</div></div><p><br></p>', 1, 15039, '2018-03-13 02:03:35', '2018-03-24 23:42:12'),
(3333, 'J436', 'Vogue Hand Operated Mincer No 10', 1, '26.99', '26.99', 16, 0, 0, 0, 46, 0, 0, 0, 0, 0, NULL, 0, 0, '1520888842.jpg', '<div class=\"tabbody\" style=\"display: block;\">\r\n<div class=\"tab-details\">\r\n<p>Produce flawlessly minced meat with ease, thanks to the Vogue hand \r\noperated mincer. Featuring high grade steel blades and plates, the \r\nmachine effortlessly minces any number of meats to speed up your \r\npreparation times. Constructed from tough cast iron, the mincer offers \r\nimmense performance and durability to keep it in excellent working \r\ncondition for longer. This model also has a strong counter clamp to keep\r\n the device safe and secure when in use.</p>\r\n<p class=\"product-features-heading\">\r\n<b>Product features</b></p>\r\n<ul><li>\r\nDimensions&nbsp;270(H) x 235(W)mm</li><li>\r\nMaterial&nbsp;Cast iron</li><li>\r\nWeight&nbsp;3.21kg</li><li>\r\nKnives and plates made of high grade steel</li></ul>\r\n</div></div><p><br></p>', 1, 15040, '2018-03-13 02:07:22', '2018-03-24 23:42:12'),
