(3471, 'UF464', 'Cast Iron Oval Sizzler (240x140mm)', 1, '8.19', '8.19', 11, 0, 0, 0, 55, 0, 0, 0, 0, 0, '', 0, 0, '1521061090.jpg', '<div class=\"tabbody\" style=\"display: block;\">\r\n<div class=\"tab-details\">\r\n<p>Serve your best curries and kebabs straight to your customers with \r\nthe Olympia Cast Iron Oval Sizzler with Wooden Stand. The wooden stand \r\nprotects your tables from the heat, giving your customers a unique and \r\nexciting dining experience you can be proud of. Stay ahead of the \r\ncompetition with this high quality cast iron pan. Easy to clean. Easy to\r\n use. Easy perfection.</p>\r\n<p class=\"product-features-heading\">\r\nProduct features</p>\r\n<ul><li>\r\nDimensionsÂ 240(W) x 140(D)mm</li><li>\r\nMaterialÂ Cast iron</li><li>\r\nFor serving kebabs and curries straight to the table</li><li>\r\nSupplied with wooden stands</li><li>\r\nIncludes Removable handle</li><li>\r\nNon-stick when seasoned</li></ul>\r\n</div></div><p><br></p>', 1, 15097, '2018-03-15 01:42:31', '2018-03-24 23:42:13'),
(3472, 'UCC311', 'Cast Iron Round Sizzler', 1, '11.59', '11.59', 11, 0, 0, 0, 55, 0, 0, 0, 0, 0, NULL, 0, 0, '1521061349.jpg', '<div class=\"tabbody\" style=\"display: block;\">\r\n<div class=\"tab-details\">\r\n<p>The Olympia Cast Iron Round Sizzler with Wooden Stand brings a unique\r\n way to display and serve food. The pan is made from high quality cast \r\niron that evenly distributes heat to ensure food is cooked quickly and \r\nefficiently. Seasoning the pan before use gives it a non-stick finish, \r\nmaking it easy to clean and allowing food to be stirred and cooked with \r\nease. A thick wooden board allows you take the pan straight to the \r\ndining tables, giving customers an exciting way to enjoy a delicious \r\nmeal.</p>\r\n<p class=\"product-features-heading\">\r\nProduct features</p>\r\n<ul><li>\r\nCapacity&nbsp;670ml</li><li>\r\nDimensions&nbsp;220(Ã˜)mm</li><li>\r\nMaterial&nbsp;Cast iron</li><li>\r\nIncludes Removable handle</li><li>\r\nNon-stick when seasoned</li></ul>\r\n</div></div>', 1, 15098, '2018-03-15 02:02:29', '2018-03-24 23:42:13'),
