(3541, 'UGJ537', 'Vogue Stainless Steel Midi Pot Wash Sink with Undershelf', 1, '329.99', '329.99', 16, 0, 0, 0, 46, 0, 0, 0, 0, 0, NULL, 0, 0, '1521122017.jpg', '<div class=\"tabbody\" style=\"display: block;\">\r\n<div class=\"tab-details\">\r\n<p>Great value 600mm deep unit with raised lip to help prevent spillage \r\nand items from slipping off. Comes complete with a rear upstand to stop \r\nitems from falling behind the sink. Adjustable feet allow stable \r\npositioning on uneven surfaces, whilst strong undershelf provides vital \r\nstorage for cleaning equipment and chemicals.</p>\r\n<p class=\"product-features-heading\">\r\nProduct features</p>\r\n<ul><li>\r\nDimensions&nbsp;960(H) x 750(W) x 600(D)mm</li><li>\r\nMaterial&nbsp;Stainless steel</li><li>\r\nWeight&nbsp;21.50kg</li><li>\r\nSupplied flat packed for easy self assembly</li><li>\r\nHygienic and easy to clean</li><li>\r\nSupplied with stand, shelf and waste</li><li>\r\nTaps sold separately</li></ul>\r\n</div></div>', 1, 15146, '2018-03-15 18:53:37', '2018-03-24 23:42:13'),
(3542, 'UU901', 'Vogue Stainless Steel Sink Right Hand Drainer 1000x600mm', 1, '346.49', '346.49', 16, 0, 0, 0, 46, 0, 0, 0, 0, 0, NULL, 0, 0, '1521122248.jpg', '<div class=\"tabbody\" style=\"display: block;\">\r\n<div class=\"tab-details\">\r\n<p>Create practical and hygienic washing areas in your kitchens with \r\nthis left and bowl sink from Vogue. The commercial sink unit is made \r\nfrom a high quality stainless steel with a galvanised steel under shelf,\r\n making it extremely durable and perfect for daily use in fast paced and\r\n demanding commercial kitchens.</p>\r\n<p class=\"product-features-heading\">\r\nProduct features</p>\r\n<ul><li>\r\nDimensions&nbsp;900(H) x 1000(W) x 600(D)mm</li><li>\r\nDimensions - external&nbsp;1000(W) x 600(D)mm</li><li>\r\nDimensions - internal&nbsp;250mm deep bowl</li><li>\r\nMaterial&nbsp;304 Stainless Steel</li><li>\r\nWeight&nbsp;36.90kg</li><li>\r\nGalvanised steel under shelf</li><li>\r\nIncludes stand, shelf and waste</li><li>\r\nDelivered flat packed for easy assembly</li><li>\r\nTaps sold separately: Y770</li><li>\r\n60mm upstand</li><li>\r\nPlease note this item exceeds 30kg and as such our carrier may require assistance at point of delivery</li></ul>\r\n</div></div><p><br></p>', 1, 15147, '2018-03-15 18:57:28', '2018-03-24 23:42:13'),
(3543, 'UCE141', 'Vogue Deep Pot Sink', 1, '364.99', '364.99', 16, 0, 0, 0, 46, 0, 0, 0, 0, 0, NULL, 0, 0, '1521123410.jpg', '<div class=\"tabbody\" style=\"display: block;\">\r\n<div class=\"tab-details\">\r\n<p>Deep bowl sink for washing large pots, pans and containers etc \r\neasily. Raised lip channels spills and splashes back into the sink, \r\nminimising over-spill and raised rear upstand prevents items from \r\nfalling behind the sink during use. Adjustable legs allow for stable \r\npositioning on almost any floor surface. Supplied with waste and wall \r\nfixings for increased stability. Taps sold separately.</p>\r\n<p class=\"product-features-heading\">\r\nProduct features</p>\r\n<ul><li>\r\nCapacity&nbsp;100Ltr</li><li>\r\nDimensions&nbsp;900(H) x 770(W) x 600(D)mm</li><li>\r\nWeight&nbsp;16.80kg</li><li>\r\nStainless steel construction</li><li>\r\nBowl size: 400(H) x 610(W)x 450(D)mm</li><li>\r\nHygienic and easy to clean</li><li>\r\nFlat packed for easy self-assembly</li></ul>\r\n</div></div>', 1, 15148, '2018-03-15 19:16:50', '2018-03-24 23:42:13'),
