(3573, 'UY724', 'Eazyzap Commercial Fly Killer', 1, '0.00', '0.00', 16, 0, 0, 0, 46, 0, 0, 0, 0, 0, '2x8W, 2x15W, 2x18W', 0, 1, '1521192052.jpg', '<p>Encased in solid metal with catchment tray, this Eazyzap Commercial Fly \r\nKiller is perfect for keeping areas free from unwanted pests such as \r\nflies, with two 8 Watt ultraviolet tubes. The highly visible tubes \r\nattract pests which then fall into a removable tray so you can easily \r\ndispose of them, maintaining a hygienic environment. To maintain optimum\r\n efficiency, bulbs should be changed every six months.<br><br>The fly killer can either be attached to your \r\nceiling using the chains provided or the unit can be set on a solid \r\nsurface such as a shelf. </p>', 1, 15158, '2018-03-16 14:20:52', '2018-03-24 23:42:13'),
